import React from "react";
import { Link } from "react-router-dom";

function  ItemList(props) {
  return (
    <div className="padre">
      <div className="container">
        <div className="card">
          <article>
            <img src={props.image} alt="imagen"></img>
            <div className="text">
              <Link to={props.id}>
                <h1> {props.name}</h1>
              </Link>
              <p>${props.precio}</p>
            </div>
          </article>
        </div>
      </div>
    </div>
  );
}

export default ItemList;
